import './Counter.css';

let count= 0
function Counter(){
    const incFn = ()=>{
      count = count+1
    }
    return(
        <div>
            counter = {count}
            <div>
                <button>DEC</button>
                <button onClick={incFn}>INC</button>
            </div>
        </div>
        
    );
}







export default Counter;
